import { combineReducers } from "redux";
const initState = {
    todoMenu: [1],
}


const addMenuItemReducer = (state = initState, action) => {
    console.log("reducer function: ", state, action)
    switch (action.type){
        case "ADD_MENU_ITEMS":
            const tempTodo = state.todoMenu.map(list => list);
            tempTodo.push(action.payload);
            return {
                todoMenu: tempTodo,
            };
        default:
            return state;
    }
}

const reducer = combineReducers({
    addMenuItemReducer
})

export default reducer;
